import React, { Component } from 'react';

export default class Home extends Component {
  render() {
    return (
      <main>
        <input
          data-testid="home-initial-message"
          placeholder="Digite algum termo de pesquisa ou escolha uma categoria."
        />
      </main>
    );
  }
}
